import { Link } from "react-router-dom";
import "./Components.css";

const Navbar = (props) => {
  return (
    <div className="top">
      <span className="navbar-logo">Best Seller Books</span>
      <span className="navbar-search">
        <form>
          <input placeholder="Search by Title, Author, etc."></input>
        </form>
      </span>
      <span className="navbar-account">My Account</span>
      <span className="cart">Cart</span>
    </div>
  );
};

export default Navbar;
